import React from "react";
import { Box, ThemeProvider, createTheme, Grid } from "@mui/material";
import { Header, Playlist, AudioPlayer } from "./components";
import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
  height: '100vh',
});


function App() {
  return (
    <ThemeProvider theme={darkTheme} sx={{}}>
      <CssBaseline />
      <Box sx={{height: "100vh", boxSizing: "border-box", display:"box"}}>
        <Header></Header>
        <Grid container>
          <Grid xs={6}>
            <Playlist></Playlist>
          </Grid>
          <Grid xs={6}>
            <AudioPlayer></AudioPlayer>
          </Grid>
        </Grid>
      </Box>
    </ThemeProvider>
  );
}

export default App;
